import logo from './main/logo.png';
import contents from './main/contents.png';
import "./styles.css";
import { useNavigate } from "react-router-dom";



export default function home() {

	const movePage = useNavigate();

	const getLoginPage = () => {
		movePage('https://signin.intra.42.fr/users/sign_in');
	}	

	return (
	<div className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <figure>
        <img src={contents} className="App-content" alt="content-bg"/>
        <figcaption><button className="App-btn" onClick={getLoginPage}></button></figcaption>
        </figure>
      </div>
	);
}
